import "./App.css";
import HomeScene from "./Scenes/HomeScene";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import PollScene from "./Scenes/PollScene";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path={`/poll/:pollId`}>
            <PollScene />
          </Route>
          <Route path="/">
            <HomeScene />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
